import React from "react";

const Sidebar = () => {
  return (
    <div class="sidenav">
      <button class="btn">Add</button>
      <button>Cat1</button>
      <button>Cat2</button>
      <button>Cat3</button>
      <button>Cat4</button>
    </div>
  );
};

export default Sidebar;
